  "full_text" : "The step parameter in sequence slicing can be negative:\n\n&gt;&gt;&gt; a = [1, 2, 3, 4, 5, 6, 7, 8]\n&gt;&gt;&gt; a[::-1] #reverse\n[8, 7, 6, 5, 4, 3, 2, 1]\n&gt;&gt;&gt; a[::-2]\n[8, 6, 4, 2]\n\n#python #pythontip",
  "lang" : "en"
