  "full_text" : "Remove duplicates from a list while keeping the order:\n\n&gt;&gt;&gt; from collections import OrderedDict\n&gt;&gt;&gt; a = [\"foo\", \"Alice\", \"bar\", \"foo\", \"Bob\"]\n&gt;&gt;&gt; list(OrderedDict.fromkeys(a).keys())\n['foo', 'Alice', 'bar', 'Bob']\n\n#python",
  "lang" : "en"
