  "favorited" : false,
  "full_text" : "Dict update method can get list of pair tuples as an input:\n\n&gt;&gt;&gt; a={1:'1'}\n&gt;&gt;&gt; b=[(3,'3'),(4,'4')]\n&gt;&gt;&gt; a.update(b)\n&gt;&gt;&gt; a\n{1: '1', 3: '3', 4: '4'}\n\nIt might be problematic if the list contains also non key/pair values. Try this:\n&gt;&gt;&gt; c=[(5,'5'), 6, (7,'7')]\n&gt;&gt;&gt; a.update(c)\n&gt;&gt;&gt; a",
  "lang" : "en",
  "contributors" : [ "12527912" ]
