  "full_text" : "How does Python find modules/packages?\n\nWhen you try\n\n&gt;&gt;&gt; import spam\n\nInterpreter looks for `spam` in sys.path folders\n\n&gt;&gt;&gt; import sys\n&gt;&gt;&gt; print(sys.path)\n\nYou can manipulate sys.path:\n\n&gt;&gt;&gt;  sys.path.append('../path/to/your/modules/')\n&gt;&gt;&gt; print(sys.path)\n\nhttps://t.co/Vko9R9gEMT https://t.co/2k9tdPle9T",
