  "created_at" : "Wed Jan 31 08:00:01 +0000 2018",
  "favorited" : false,
  "full_text" : "Does your #numpy array contain missing values? \n\n&gt; import numpy as np\n&gt; x = np.array([1,2,3,np.nan])\n\nYou can remove them:\n\n&gt; x[~np.isnan(x)]\narray([ 1.,  2.,  3.])\n&gt; np.nanmean(x)\n2.0\n\nOr replace them by a number:\n\n&gt; np.nan_to_num(x,0)\narray([ 1.,  2.,  3.,  0.]) \n\n#pythontip",
  "lang" : "en"
