  "favorited" : false,
  "full_text" : "The tilde ~ is the unary negation operator:\n\n&gt;&gt;&gt; import numpy as np\n&gt;&gt;&gt; ~ np.array([True,False])\narray([False,  True], dtype=bool)\n\nBe aware that using ~ to scalars can lead to unexpected results:\n\n &gt;&gt;&gt; ~ True\n-2\n&gt;&gt;&gt; ~ False\n-1\n&gt;&gt;&gt; ~ np.isfinite(np.inf)\nTrue\n\n#pythontip",
  "lang" : "en"
