  "full_text" : "Know the difference between append() and extend():\n\n&gt;&gt;&gt; x = [1,2,3]\n&gt;&gt;&gt; x.append([4,5])\n&gt;&gt;&gt; x\n[1, 2, 3, [4, 5]]\n&gt;&gt;&gt; x.extend([6,7])\n&gt;&gt;&gt; x\n[1, 2, 3, [4, 5], 6, 7]\n&gt;&gt;&gt; x.extend(\"abc\")\n&gt;&gt;&gt; x\n[1, 2, 3, [4, 5], 6, 7, 'a', 'b', 'c']\n\nhttps://t.co/qbMrM1bRAf",
