  "full_text" : "Do you need to save a large object?\n\nimport numpy as np\nx = np.zeros((1000,1000))\n\nCompress your pickle file\n\nimport gzip, cPickle\nwith https://t.co/wFbykHTCKH('tmp.gz','wb') as f:\n  cPickle.dump(x, f, 2)\n\nOr take advantage of savez_compressed:\n\nnp.savez_compressed('tmp.npz', x)",
  "lang" : "en"
