  "full_text" : "f(x) = log(1+x) is a common transformation for non-negative data. With #numpy, use log1p(x), not log(x)+1, to get a better precision for small numbers:\n\n&gt;&gt;&gt; import numpy as np\n&gt;&gt;&gt; np.log1p(1e-99)\n1e-99\n&gt;&gt;&gt; np.log(1 + 1e-99)\n0.0\n\nThe inverse function is 'expm1'.\n\n#pythontip #numpy",
  "lang" : "en"
