  "full_text" : "Use itertools.chain to iterate over items in separate lists:\n\n&gt;&gt;&gt; from itertools import chain\n&gt;&gt;&gt; x = [1, 2, 3]\n&gt;&gt;&gt; y = [5, 6, 7]\n&gt;&gt;&gt; z = ['a', 'b']\n&gt;&gt;&gt; for item in chain(x, y, z):\n...     print(item)\n... \n1\n2\n3\n5\n6\n7\na\nb\n\n#python #itertools",
  "lang" : "en",
  "contributors" : [ "12527912" ]
