  "created_at" : "Wed Jul 04 06:00:00 +0000 2018",
  "favorited" : false,
  "full_text" : "zip() is its own inverse (via @jakevdp):\n\n&gt;&gt;&gt; data = [(1, 2, 3), ('a', 'b', 'c')]\n&gt;&gt;&gt; zipped = zip(*data)\n&gt;&gt;&gt; zipped\n[(1, 'a'), (2, 'b'), (3, 'c')]\n&gt;&gt;&gt; unzipped = zip(*zipped)\n&gt;&gt;&gt; unzipped\n[(1, 2, 3), ('a', 'b', 'c')]\n\n#pythontip #zip",
  "lang" : "en"
